import React from 'react';
import { useForm } from 'react-hook-form';


export default function Login({loggedIn, loggingUser, message, logout, omniauth}) {

const { register, handleSubmit } = useForm()



  return (
    <div>
      <h1>Login</h1>
      <h3>{message ? message : null }</h3>
      <form onSubmit={handleSubmit((data) =>{
       loggingUser(data.email, data.password)
      })}>
        <p>Status: {loggedIn ? 'connected' : 'not connected'}</p>
      <label  htmlFor='email'>Email :</label>
      <input {...register('email', {required: true})} type="email" placeholder='email'/>
      <label  htmlFor='password'>password :</label>
      <input {...register('password', {required: true})} placeholder='password' />
      <input type='submit' />

      </form>
      <button onClick={() => logout()}>logout</button>
      <button onClick={() => omniauth()}>GOOGLE</button>
      <form action="http://www.google.com">
          <input type="submit" value="Go to Google" />
      </form>
    </div>
  )
}
